import React from "react";
import "./ConversationTable.css";

const ConversationTable = ({ data }) => {
  return (
    <div className="table-container">
      <h2>Conversation History</h2>
      <table className="conversation-table">
        <thead>
          <tr>
            <th>Session ID</th>
            <th>Conversation</th>
            <th>Flag</th>
          </tr>
        </thead>
        <tbody>
          {data && data.length > 0 ? (
            data.map((item, index) => (
              <tr key={index}>
                <td>{item.sessionId}</td>
                <td style={{ whiteSpace: "pre-wrap" }}>{item.input}</td>
                <td>{item.flag ? "True" : "False"}</td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="3">No conversations found.</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default ConversationTable;
